import React from 'react';

import {Login} from './Login';

class Calendar extends React.Component {

  constructor() {
    super();
    this.state = {
      firstName : '',
      lastName : "",
      gmail : ""
    };
  }

  updateUserData = (profileObj) => {
    this.state.firstName = profileObj.givenName
    this.state.lastName = profileObj.familyName
    this.state.gmail = profileObj.gmail
    console.log("From Calendar:", profileObj)
  }

  render() {
    return (
      <React.Fragment>
        <p>Sign in to download calendar data</p>
        <button>Sign in with Google</button>
        <a href="/meeting">Meeting Page</a>
        <p>This will contain an empty calendar which will be filled in when signed in</p>

        <p>firstName: {this.state.firstName}</p>

        <Login updateUserData={this.updateUserData} />

      </React.Fragment>
    )
  }
}

export default Calendar
